import React from "react";
import "./navbar.scss";

const Navbar = () => {
	return (
		<div className="navbar">
			<div className="content-logo">
				<i className="fas fa-crown fa-4x"></i>
			</div>
			<div>
				<ul>
					<li>Shop</li>
					<li>About us</li>
					<li>List item 3</li>
					<li>List item 4</li>
				</ul>
			</div>
			<div>
				<ul>
					<li></li>
					<li></li>
					<li></li>
					<li></li>
				</ul>
			</div>
		</div>
	);
};

export default Navbar;
